  input: 'TEXT,F3XA,,"Response to FEC letter of Sept. 5, 2007, reference the August
    Monthly Report.  Additional information with regard to contribution of $29,005.31
    received on July 17, 2007 from the Allen Victory Committee is as follows:  After
    the Allen Victory Committee terminated its registration on Jan. 31, 2007, it received
    2 refund checks from the RNC related to deposits for travel expenses for 2 Presidential
    trips.  These funds were then distributed to its affiliated committees/joint fundraising
    participants which included the Republican Party of Virginia.  Thus, the money
    RPV received from the Allen Victory Committee was in the nature of a final refund
    on travel expenses and disbursement to close out that committee.  Mr. Daniel Buckley
    of the FEC Reports Analysis Division was contacted for guidance on this matter.  The
    letter to the FEC from the Allen Victory Committee is dated June 29, 2007.  Thank
    you for your help in this matter."'
